import React from 'react';

const Home = () => {
  return (
    <div className="container mx-auto py-10">
      <h1 className="text-3xl font-bold mb-4">Welcome to my website!</h1>
      <p className="text-lg">Here you can find information about me and my projects.</p>
    </div>
  );
}

export default Home;
